import React, { useState } from 'react';

function App() {

  const [userQuery, setUserQuery] = useState('');

  const updateUserQuery = event => {

    setUserQuery(event.target.value)
  }

  return (
    <div className="App">
      <input value={userQuery} onChange={updateUserQuery}>
      <button>Search</button>
      </input>
    </div>
  );

}

export default App;
